        }
    }

    public sealed class NP_ClientConnected : NetPacket
    {
        public NP_ClientConnected() : base(1, 0x00)
        {
            ns.Write((short)0x00);
            ns.Write((byte)0x00);
            //Main address
            ns.Write((byte)0x01);
            ns.Write((byte)0x00);
            ns.Write((byte)0x00);
            ns.Write((byte)0x7f); // IP 127.0.0.1
            ns.Write((short)0x4e2); //= 1250, 0x04D5 = 1237 Port
            //Main address
            ns.Write((byte)0x01);
            ns.Write((byte)0x00);
            ns.Write((byte)0x00);
            ns.Write((byte)0x7f);
            ns.Write((int)0x0); //Undefined
        }
    }
